import React from 'react';
import Drawer from '@mui/material/Drawer';
import './RightDrawer.css';

const RightDrawer = () => {
  return (
    <Drawer
      sx={{
        width: '15rem',
        flexShrink: 0,
        '& .MuiDrawer-paper': {
          width: '15rem',
          boxSizing: 'border-box',
        },
      }}
      variant='permanent'
      anchor='right'
    >
      <h1>Feature Distributions:</h1>
    </Drawer>
  );
};

export default RightDrawer;
